import React, { useState } from 'react';
import { Link, useNavigate } from "react-router-dom";
import axios from 'axios';

function First() {
    const [team, setTeam] = useState('');
    const [dateFirst, setDateFirst] = useState('');
    const navigate = useNavigate();

    const handleSubmit = () => {
        axios.post('http://localhost:8070/router/add', {
            team: team,
            date: dateFirst,
           
        })
        .then(response => {
            console.log(response.data);
            navigate('/Third');
        })
        .catch(error => {
            console.error('There was an error!', error);
        });
    };

    return (
        <div>
            <label>Team</label>
            <input type="text" name="team" value={team} onChange={(e) => setTeam(e.target.value)} /> <br/>
            
            <label>Date</label>
            <input type="date" name="dateFirst" value={dateFirst} onChange={(e) => setDateFirst(e.target.value)} /> <br/>

            <button type="button" onClick={() => navigate('/Second')}>Start</button> <br/>

            <input type="submit" onClick={handleSubmit} name="searchsubmit" value="Search"/>
        </div>
    );
}
//<button type="button" onClick={handleSubmit}>Start</button> <br/>
export default First;
